constexpr std::string_view reasoning_content =
    R"==(Okay, the user is asking why the sky is blue. This seems like a basic science question, probably from someone curious about everyday phenomena. I remember this involves Rayleigh scattering - but how to explain it simply?

Hmm, they might be a student or just a curious adult. Either way, they deserve a clear explanation without jargon. I should start with sunlight composition - white light containing all colors. Then mention Earth's atmosphere full of tiny particles.

The key is size comparison: gas molecules are much smaller than light wavelengths. That's why they scatter blue more efficiently. Should I mention violet? Yes, but need to explain why we see blue instead - human eye sensitivity and atmospheric effects on violet.

Visual examples might help: sunrise colors showing longer wavelengths dominating when light travels farther. Oh, and must clarify it's not about ocean reflection - common misconception.

Better structure it:
1) Sunlight spectrum
2) Atmospheric particles
3) Scattering mechanism
4) Why blue dominates
5) Bonus: sunset colors

Keep it friendly - maybe add that "amazing world" touch at the end. They asked a fundamental question about our world; that wonder deserves acknowledgment.)==";

constexpr std::string_view content =
    R"==(The sky appears blue due to a phenomenon called **Rayleigh scattering**, which involves the interaction of sunlight with Earth's atmosphere. Here's a step-by-step explanation:

### 1. **Sunlight Composition**:
   Sunlight appears white, but it contains all colors of the visible spectrum (red, orange, yellow, green, blue, indigo, violet).

### 2. **Earth's Atmosphere**:
   The atmosphere is mostly nitrogen (78%) and oxygen (21%), with tiny molecules of gas, water vapor, and dust.

### 3. **Scattering of Light**:
   When sunlight enters the atmosphere, it collides with gas molecules and small particles.
   - **Shorter wavelengths** (blue/violet light) scatter more easily because they interact more strongly with small molecules.
   - **Longer wavelengths** (red/orange light) pass through more directly.

   <div style="text-align: center;">
    <img src="https://upload.wikimedia.org/wikipedia/commons/thumb/0/09/Rayleigh_sunlight_scattering.svg/640px-Rayleigh_sunlight_scattering.svg.png" alt="Rayleigh Scattering Diagram" width="400"/>
    <p><em>Rayleigh scattering: Shorter blue wavelengths scatter in all directions.</em></p>
   </div>

### 4. **Why Blue Dominates**:
   - Blue light (wavelength: ~450 nm) scatters **10 more** than red light (~650 nm).
   - This scattered blue light reaches our eyes from all directions, making the sky appear blue.

### 5. **Why Not Violet?**
   Sunlight contains slightly more blue than violet light, and human eyes are more sensitive to blue. Violet light is also partially absorbed by the upper atmosphere.

### 6. **Sunsets and Sunrises**:
   At dawn/dusk, sunlight travels through more atmosphere. Blue light scatters away, leaving longer wavelengths (reds/oranges) to reach your eyes.

### Key Formula (Rayleigh Scattering Intensity):
\[ I \propto \frac{1}{\lambda^4} \]
*Scattering intensity (\(I\)) is inversely proportional to the wavelength (\(\lambda\)) raised to the fourth power.*
 Shorter \(\lambda\) (blue) scatters far more than longer \(\lambda\) (red).

### Fun Fact:
If Earth had no atmosphere (like the Moon), the sky would appear blackeven during the day! This is why astronauts see a dark sky.

**In short**: The sky is blue because air molecules scatter short-wavelength blue light more efficiently than other colors, flooding our field of view with blue from every direction. )==";

